.fpev-timeline.p-timeline .p-timeline-event .p-timeline-event-separator .ativo.circle {
  --g: 1px;
  /* The gap between shapes*/
  --s: 5px;
  border: none;
  color: var(--bs-primary);
  transform: scale(2);
  background: var(--bs-white);
  display: inline-block;
}
.fpev-timeline.p-timeline .p-timeline-event .p-timeline-event-separator .ativo.circle:before, .fpev-timeline.p-timeline .p-timeline-event .p-timeline-event-separator .ativo.circle:after {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  border: var(--s) solid var(--c, --bs-warning);
  border-radius: 50%;
  clip-path: polygon(calc(50% + var(--g) / 2) 50%, calc(50% + var(--g) / 2) 0%, 105% 0%, 105% calc(33.745% - var(--g) / 2), 50% calc(50% - var(--g) / 2));
}
.fpev-timeline.p-timeline .p-timeline-event .p-timeline-event-separator .ativo.circle:after {
