  --c: var(--bs-primary);
  border-width: calc(var(--s) / 2);
  top: calc(var(--s) / 4);
  left: calc(var(--s) / 4);
  right: calc(var(--s) / 4);
  bottom: calc(var(--s) / 4);
}
