/*/===== VARIABLES CSS =====//
:root {
    --sidebar-width: 360px;

    //===== Colors
    --base-color: #ff7f6f;
    --secondary-color: #ff8961;
    --blue-color: #485c7a;
    --blue-color-light: #485c7a80;
    --medium-color: #fcfcfc;
    --white-color: #ffffff;
    --dark-color: #222222;
    --gray-color: #e9ecef; 

    //===== Font and typography
    --body-font: 'Roboto', sans-serif;
    --normal-font-size: 1rem;

    // effects
    --shadow: 0 0px 3px -2px rgba(0, 0, 0, 0.2), 0 0px 4px 0 rgba(0, 0, 0, 0.14), 0 0px 8px 0 rgba(0, 0, 0, 0.12);
}

//===== BASE =====//
*,
::before,
::after {
    box-sizing: border-box;
    // user-select: none;
}

body {
    position: relative;
    font-family: var(--body-font) !important;
    font-size: var(--normal-font-size);
    transition: 0.5s;
    background-image: url('/assets/bg-repeat.png');
    background-repeat: repeat;
    height: 100vh;
    backdrop-filter: blur(1px);
}

main {
    position: relative;
}

a {
    text-decoration: none;
    color: var(--base-color) !important;
    cursor: pointer;

    &:hover {
        text-decoration: none !important;
    }
}

.disabled {
    opacity: 0.7;
    pointer-events: none;
}

.p-field-checkbox label {
    margin-bottom: unset !important;
}

.p-grid {
    margin: 0 !important;
}

.p-field label {
    font-size: 14px;
    font-weight: 500;
    color: var(--blue-color);
}

*:focus {
    outline: none !important;
    box-shadow: none;
}

*:focus-visible {
    outline: 0 none !important;
    outline-offset: 0;
    box-shadow: 0 0 0 0.2rem #ffc4b0;
}

.tabVertical {
    .p-tabview-nav {
        border: none;
        gap: 4px;

        li {
            .p-tabview-nav-link {
                justify-content: center;
                color: var(--blue-color) !important;
                background: #edeff2;
                margin: 0;

                border: 1px solid transparent;
                border-right: none;
                border-radius: 8px;

                &:hover {
                    text-decoration: none;
                    border-color: transparent !important;
                    background: #dce0e4 !important;
                }
            }

            &.p-highlight .p-tabview-nav-link {
                background: var(--medium-color);
                border: 1px solid rgba(0, 0, 0, 0.1);
                overflow: visible;
                color: var(--base-color) !important;

                &:hover {
                    text-decoration: none;
                    border-color: rgba(0, 0, 0, 0.1) !important;
                    background: var(--medium-color) !important;
                }
            }
        }
    }

    .p-tabview-panels {
        width: 100%;
        background: var(--medium-color);
        border: 1px solid rgba(0, 0, 0, 0.1);
        border-radius: 8px;
        margin-top: 24px;

        .p-tabview-panel {
            height: 100%;
        }
    }
}

.cadastros-modal,
.generic-modal {
    width: 700px;
    border-radius: 8px;
    overflow: hidden;

    .p-dialog-header {
        background: var(--medium-color);
        border-bottom: 1px solid var(--base-color);
        .p-dialog-title,
        .p-dialog-header-icon {
            color: var(--blue-color);
        }
    }

    .p-dialog-content {
        padding-top: 16px;
    }
}

.saveBtn {
    text-align: right;
    margin: 8px;
}

.p-grid.label-generator {
    gap: 16px 0;

    > div {
        padding: 0 8px !important;
    }
}

.label-generator-bg {
    padding: 24px 16px 16px 16px;
    background: var(--medium-color);
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-left: 4px solid var(--base-color);
    margin: 0 0 16px;
}

.label-generator-detalhe-btn {
    margin: -16px;
    border-top: 1px solid rgba(0, 0, 0, 0.1);
    margin-top: 16px;

    .p-button-label {
        font-weight: 500;
    }
}

.gmaps-link {
    position: relative;
    top: 4px;
    font-size: 20px;
    border-radius: 20px;
    cursor: pointer;
    color: var(--blue-color);
}

::-webkit-scrollbar {
    width: 10px;
}

::-webkit-scrollbar-track {
    background: #f1f1f1;
}

::-webkit-scrollbar-thumb {
    background: var(--base-color);
}

::-webkit-scrollbar-thumb:hover {
    background: var(--secondary-color);
}

@media screen and (max-width: 425px) {
    .p-toast {
        width: 80% !important;
    }
}

@media screen and (max-width: 768px) {
    .cadastros-modal,
    .generic-modal {
        width: 90% !important;
    }
}

@media screen and (min-width: 992px) {
    .tabVertical {
        display: flex;
        // min-height: 550px;
        gap: 12px;

        .p-tabview-nav {
            flex-direction: column;
            gap: 12px;

            li {
                .p-tabview-nav-link {
                    min-width: 180px;
                }

                &.p-highlight .p-tabview-nav-link {
                    border-right: none;
                    border-radius: 8px 0 0 8px;
                    color: var(--blue-color) !important;

                    &::before {
                        content: '';
                        background: var(--medium-color);
                        width: 13px;
                        height: 58px;
                        position: absolute;
                        top: -1px;
                        right: -13px;
                        border-top: 1px solid;
                        border-bottom: 1px solid;
                        border-color: rgba(0, 0, 0, 0.1);
                    }

                    &::after {
                        content: '';
                        background: var(--base-color);
                        width: 4px;
                        height: 58px;
                        position: absolute;
                        top: -1px;
                        left: 0px;
                        border-radius: 8px 0 0 8px;
                    }
                }
            }
        }

        .p-tabview-panels {
            border-radius: 0 8px 8px 0;
            margin: 0;
            min-height: 60vh;
        }
    }
}

@keyframes scale-animation {
    from {
        transform: scale(0.8);
    }
    to {
        transform: scale(1);
    }
}

@keyframes translateY-animation {
    from {
        transform: translateY(20px);
        opacity: 0;
    }
    to {
        transform: translateY(0px);
        opacity: 1;
    }
}

.scale-animation {
    transform: scale(0.8);
    animation: scale-animation 150ms 0ms;
    animation-fill-mode: forwards;
    will-change: transform;
}

.translateY-animation {
    transform: translateY(20px);
    opacity: 0;
    animation: translateY-animation 350ms 0ms;
    animation-fill-mode: forwards;
    will-change: transform, opacity;
}

nav{
    background-color: rgba(0, 0, 0, 0.1);
}

